window.bookSummaryJSON = "<p>GenE must outwit Codebreakers to win a high stakes (Real Player Game) RPG for terminal patients who made the “Intelligence Donor List”, where failure equals death in real life, and winning means eternal life.&nbsp;</p> <p>Teaming up with competitive gamers increases GenE’s chances of surviving the challenges of each level, until she realizes her most trusted ally is using her. And rules? Rules are made to be reprogrammed, along with everything else.&nbsp;</p>"; 
